import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Navbar extends Component {
    render() {
        return(
        <nav className="nav">
            <ul>
            <li key="li1"><Link to="/">My Playlist</Link></li>
            <li key="li2"><Link to="/create">Add Expense</Link></li>
            </ul>
        </nav>
        )
    }
}

export default Navbar;
